import React, { useState } from 'react';
import './SearchBar.css';
// import { icon } from '../img/search-icon.svg';

function SearchBar(props) {
    function handleEvent() {
        const strings = [];
        const listItems = strings.map(
            (string, i) => <li key={'string' + i}>{string}</li> )
    };
    return(
        <div className="searchBar">
            <div className="search">
                <input 
                    className="searchInput"
                    type="text"
                    placeholder="Type here for the song"
                    name="searchInput"
                    value={props.value}
                    onChange={(event) => props.onSearch(event.target.value)}/>
                <button className='searchButton' onClick={handleEvent}>
                    <img className="searchIcon" src="../img/search-icon.svg" alt="Search"/>
                </button>
            </div>
        </div>,
        listItems
    )
};

export default SearchBar;
